import React, { Component } from 'react';
import Styles from "./biography.module.css";
import welcome from "../picture/welcome.gif";
import ax_1 from "../picture/1.png";
import ax_2 from "../picture/2.png";
import ax_3 from "../picture/3.png";
import NrzJvd from "../picture/nrzjvd.gif";

class Biography extends Component {
    render() {
        return (
            <div className={Styles.conteiner}>
                <div className={Styles.header}>
                    <img src={welcome} alt="bio_pic"/>
                </div>
           
            <div className={Styles.Main}>
            <img><source src={ax_1}/></img>
            <img><source/></img>
            <img><source/></img>
                </div>
           
               
            <div className={Styles.me}>
            <img src={NrzJvd} alt="bio_pic"/>
            </div>        
            </div>
        );
    }
}

export default Biography;
